import React from 'react'
import Navbar from '../../Components/Home/navbar'
import Searchbar from '../../Components/Home/Searchbar'



const home = () => {
  return (
    <div>
      {/* {Page Headder} */}
      <Navbar/>

      {/* {Page Body} */}
      <Searchbar/>

      {/* {Blog List} */}
      <BlogList/>
    </div>
  )
}

export default home
